import React from "react";

import SiteButton from "../UI/SiteButton";
import Header from "../Components/Header";
import SubPortfolioInfo from "../UI/SubPortfolioInfo";
import CategoriBox from "../UI/CategoriBox";
import Footer from "../Components/Footer";

import classes from "./Compose.module.css";

const Dyson = () => {
  return (
    <div
      style={{
        width: "100%",
        maxWidth: "1920px",
        margin: "0 auto",
        position: "relative",
      }}
    >
      <Header bgColor=" " titleColor="#ffffff" />

      <div
        style={{
          background: "url(images/sub_nespresso_banner.png)",
          width: "100%",
          height: "980px",
          margin: "0 auto",
        }}
      ></div>

      <SiteButton
        className={classes.composeBtn}
        btnColor="#71ab4d"
        textColor="#ffffff"
        top="775px"
        left="370px"
        link="dyson/index.html"
      />

      <SiteButton
        className={classes.composeBtn}
        btnColor="#71ab4d"
        textColor="#ffffff"
        width="452px"
        top="6390px"
        link="dyson/index.html"
        left="50%"
        transX="-50%"
      />

      <Footer footerTop="6500px" />
      {/* <img src="images/dyson.png" alt="다이슨" /> */}
    </div>
  );
};

export default Dyson;
